import logo from "./logo.svg";
import "./App.css";
import { Navbar, Container, Link } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <Navbar>
      <Container>
        <Navbar.link href="#">Home</Navbar.link>
        <Navbar.link href="#">Service</Navbar.link>
      </Container>
    </Navbar>
  );
}

export default App;
